import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Card from "./Card";

import "tachyons";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Card />
  </React.StrictMode>
);

// ReactDOM.render(<Card />, document.getElementById("root"));
ReactDOM.render(<Card />, document.getElementById("root"));
